"""# **4. Scaling Numeric Features in numerical columns**

# Let's use MinMaxScaler from sklearn.preprocessing to scale values to the (0,1) range
# " note " : the range(0,1) is better for Logistic Classification problems
"""

from sklearn.preprocessing import MinMaxScaler

scaler=MinMaxScaler()

