"""# **5. Handling categorical  columns through Encoding Categorical Data**

## Encoding Categorical Data

 Convert categorical data into numbers using one-hot encoding for categorical columns.

<img src="https://i.imgur.com/n8GuiOO.png" width="640">

One hot encoding involves adding a new binary (0/1) column for each unique category of a categorical column.
"""

df[categorical_cols].nunique()

"""## We can perform One Hot Encoding using one hot encoder from sklearn.preprocessing"""

from sklearn.preprocessing import OneHotEncoder

encoder=OneHotEncoder(sparse=False,handle_unknown='ignore')

encoder.fit(df[categorical_cols])

encoder.categories_

categorical_cols

encoded_cols = list(encoder.get_feature_names_out(categorical_cols))
encoded_cols

test_input[categorical_cols]

