val_input[encoded_cols] = encoder.transform(val_input[categorical_cols].fillna('unknown'))
test_input[encoded_cols] = encoder.transform(test_input[categorical_cols].fillna('unknown'))

#concatinate train,val,test original data (categorical cols) with train,val,test (encoded cols),test original data (categorical cols) with encoded cols
train_df = pd.concat([train_input[categorical_cols], train_input[encoded_cols]],axis=1)
val_df = pd.concat([val_input[categorical_cols], val_input[encoded_cols]],axis=1)
test_df = pd.concat([test_input[categorical_cols], test_input[encoded_cols]],axis=1)

test_input[encoded_cols]

